import Post from '../components/Post';
import '../style/Home.css'

function Home() {

  const test = { name:"Sar planinac", date:"1.1.2022", content:"Lorem ipsum dolor, sit amet consectetur adipisicing elit. Enim quia non libero nemo eum porro laborum? Beatae dolorum optio ab, laudantium sit temporibus illo, architecto adipisci, debitis vero deserunt fugit!", image:"https://images.dog.ceo/breeds/leonberg/n02111129_454.jpg" }

  return (
    <div>
      <Post post={test} />

    </div>
  );
}

export default Home;
